import {
  Grid,
  CircularProgress,
  Link,
  Avatar,
  ListItemButton,
  Button,
  Box,
  Typography,
} from "@mui/material";
import React, { useEffect, useState } from "react";
// import Form from '../Form/Form';
// import Post from "./Post/Post";
// import DraftsIcon from '@mui/icons-material/Drafts';

function People() {
  const [allProfiles, setAllProfiles] = useState();
  const [sendertoken, setSendertoken] = useState(localStorage.getItem("token"));
  const [requestStatus, setRequestStatus] = useState([]);
  const [friendStatus, setFriendStatus] = useState("Add Friend");
  const [requesterEmail, setRequesterEmail] = useState("");
  var index = -1;
  async function getProfiles() {
    const req = await fetch("http://localhost:1337/api/getAllProfiles", {
      headers: {
        "x-access-token": localStorage.getItem("token"),
      },
    });
    const data = await req.json();

    setAllProfiles(data.profiles);
    setFriendStatus(data.friendStatus);
    setRequesterEmail(data.requesterEmail);

    // for(let i = 0; i < data.friendStatus.length; i++){
    //   console.log("iteration",i)
    // data.friendStatus=='Requested'?setRequestStatus('Requested'):setRequestStatus('Add Friend')
    // }
  }

  async function addFriend(recevierEmail) {
    const req = await fetch("http://localhost:1337/api/addFriend", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        recevierEmail,
        sendertoken,
      }),
    });
    const data = await req.json();
    // if (data.status == 'Request Sent') { setRequestStatus('Requested') }
    console.log(data);
  }

  async function cancelRequest(recevierEmail) {
    const req = await fetch("http://localhost:1337/api/cancelRequest", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        recevierEmail,
        sendertoken,
      }),
    });
    const data = await req.json();
  }

  async function removeFriend(recevierEmail) {
    const req = await fetch("http://localhost:1337/api/removeFriend", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        recevierEmail,
        sendertoken,
      }),
    });
    const data = await req.json();
    // if (data.status == 'Request Sent') { setRequestStatus('Add Friend') }
    // console.log(data);
  }

  useEffect(() => {
    getProfiles();
  });
  return allProfiles ? (
    !allProfiles.length ? (
      <Box className="circularProgress">
        {" "}
        <CircularProgress />
      </Box>
    ) : (
      <>
        <Grid
          className="container"
          sx={{
            alignItems: "center",
            flexDirection: "column",
            justifyContent: "center",
          }}
          container
          spacing={2}
        >
          {allProfiles.map(
            (profile) => (
              (index = index + 1),
              (
                //  console.log(friendStatus),
                <Grid
                  sx={{ width: { md: "100%", sm: "80%", xs: "100%" } }}
                  key={profile._id}
                  item
                  xs={12}
                  sm={12}
                >
                  <Box className="friendRequests">
                    <Box
                      sx={{
                        p: 1,
                        m: 0,
                        borderRadius: 3,
                        flexDirection: "column",
                        alignItems: "center",
                      }}
                    >
                      <Box
                        sx={{
                          flexDirection: "row",
                          display: "flex",
                          width: "100%",
                          justifyContent: "space-between",
                        }}
                      >
                        <Avatar
                          src={profile.profilePicture}
                          sx={{ width: 60, height: 60 }}
                        ></Avatar>
                        <Box sx={{ width: "100%", ml: "3%" }}>
                          <Typography
                            sx={{ color: "lack", fontWeight: 900, mt: "3%" }}
                          >
                            {profile.firstName + " " + profile.lastName}
                          </Typography>
                          <Typography
                            sx={{
                              color: "gray",
                              fontSize: "13px",
                              fontWeight: 200,
                              mt: "3%",
                            }}
                          >
                            0 mutual friends
                          </Typography>
                        </Box>
                        {console.log()}

                        {profile.friendRequests[index] == requesterEmail ? (
                          <Button
                            variant="contained"
                            onClick={() => addFriend(profile.email)}
                            sx={{

                              fontWeight: 900,
                              width: "50%",
                              height: "50px",
                              m: 0,
                              p: 0,
                              borderRadius: 2,
                            }}
                          >
                            Add Friend
                          </Button>
                        ) : (
                          <Button
                            variant="contained"
                            onClick={() => cancelRequest(profile.email)}
                            sx={{
                                 fontWeight: 900,
                              width: "50%",
                              height: "50px",
                              m: 0,
                              p: 0,
                              borderRadius: 2,
                              backgroundColor: "gray",
                            }}
                          >
                            Cancel Request
                          </Button>
                        )}

                        {/* <Button variant="contained" onClick={() => removeFriend(profile.email)} sx={{ fontWeight: 900, width: '50%', height: '50px', m: 0, p: 0, borderRadius: 2 }}>Remove Friend</Button> */}
                      </Box>
                    </Box>
                  </Box>
                </Grid>
              )
            )
          )}
        </Grid>
      </>
    )
  ) : (
    <></>
  );
}

export default People;
